import { Http } from '../../config/Http';

export const index = () => dispatch => {
  try {
    Http.get('/item')
    .then( (response) => {
      dispatch({
        type: 'INDEX_ITEMS',
        payload: response.data
      })
    })
  } catch (err) {
    return (err)
  }
  
}
